import { Routes,Route } from 'react-router-dom';
import Transactions from './Transactions';

function App() {

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Transactions />} />
		<Route path="/home" element={<Home />}/>
      </Routes>
    </div>
  );
}

export default App;
